column18:
Schweinefleisch (80%), Trinkwasser, Nitritpökelsalz (Kochsalz, Konservierungsstoff: Natriumnitrit), Gewürzextrakte, Stabilisator: Diphosphate, gekörnte Brühe (Kochsalz, hydrolysiertes Pflanzeneiweiß), Geschmacksverstärker: Mononatriumglutamat, Antioxidationsmittel: Ascorbinsäure, Natriumascorbat, Aroma, Schweinedarm, Buchenholzrauch;
Kann Spuren von Senf und Käse (laktosefrei) enthalten.
Gluten- und Laktosefrei
